import React from 'react';
function App() {

  return (
    <div className="App">
      <h1>Crypto Values</h1>
      <table>
        <th>Crypto Code</th>
        <input name="crypto_name"></input><br />
        <th>Currency</th> <input name="currency"></input><br />
      </table>
      <input type="button" value="Submit" name="submit"></input>
      <input type="button" value="Cancel" name="Cancel"></input>

    </div>
  );
}

export default App;
